 ('1f08624529d64ef1b8a4a0312d589086','CI0024','푸르비에르 언덕 Fourviere Hill','리옹 역사지구의 중심에 있는 언덕으로 로마시대부터 만들어진 건물들이 들어서 있다. 언덕 꼭대기에는 푸르비에르 노틀담 성당이 있으며, 전망대에서 내려다 보면 리옹의 론(Rhone)강과 손(saone)강, 파르디외(Part Dieu) 지구 등 시가지를 한눈에 둘러볼 수 있다.','1-2 Fourvière Square, 69005 Lyon, France','UUID-1111-1111111','2018-07-24 14:45:48','UUID-1111-1111111','2018-07-24 14:45:48'),
